import React from 'react';
import '../App.css';
import { Route, Router } from 'react-router-dom';
import ProductIndex from './products/ProductIndex';

const App = () => {
  return (
    <div>
      <h1>Online Store</h1>
      <Router>
        <Route exact path="/" component={ProductIndex} />
      </Router>
    </div>
  );
};

export default App;
